    text3:
      "A Vidqu está comprometida em proteger sua privacidade o tempo todo. Seu uso dos Serviços também está sujeito à <a href='/privacy.html'>Política de Privacidade</a> da Vidqu (a “Política de Privacidade”), que é incorporada por referência e faz parte dos TOS. É importante que você leia e compreenda os termos da nossa Política de Privacidade.",
