    text7:
      "Você não pode usar como nome de usuário o nome de outra pessoa ou entidade que não esteja legalmente disponível para uso ou um nome ou marca registrada que esteja sujeito a quaisquer direitos de outra pessoa ou entidade que não você, sem a devida autorização. Você não pode usar como nome de usuário qualquer nome que seja ofensivo, vulgar ou obsceno.",
