    text33:
      "Qualquer informação referente ao Cliente e seus respectivos Registros de Clientes pode ser passada a terceiros. No entanto, os Registros de Clientes são considerados confidenciais e, portanto, não serão divulgados a nenhum terceiro além de nossos funcionários e, se legalmente obrigados a fazê-lo, às autoridades competentes. Os clientes têm o direito de solicitar a visualização e cópias de quaisquer e todos os Registros de Clientes que mantemos, desde que nos seja dado um aviso prévio razoável de tal solicitação. Solicitamos aos clientes que mantenham cópias de qualquer literatura emitida em relação à prestação de nossos serviços. Quando apropriado, emitiremos ao Cliente as informações escritas apropriadas, folhetos ou cópias dos registros como parte de um contrato acordado para o benefício de ambas as partes. Fornecemos a você uma opção para visualizar todas as suas informações mantidas por nós, mediante sua solicitação.",
    text34:
      "Não venderemos, compartilharemos ou alugaremos suas informações pessoais a nenhum terceiro, nem usaremos seu endereço de e-mail para correspondência não solicitada. Qualquer e-mail enviado por esta Empresa estará apenas em conexão com a prestação dos serviços e produtos acordados.",
    text35:
      "Se você deseja comprar qualquer produto ou serviço disponibilizado pela Empresa (“Pagamento”), poderá ser solicitado a fornecer certas informações relevantes para o seu Pagamento, incluindo, sem limitação, o número do seu cartão de crédito, a data de validade do seu cartão de crédito e o seu endereço de cobrança. Você declara e garante que:",
    text36:
      "(i) você tem o direito legal de usar qualquer cartão de crédito(s) ou outro(s) método(s) de pagamento em conexão com qualquer Pagamento; e",
    text37:
      "(ii) as informações que você nos fornece são verdadeiras, corretas e completas. Podemos empregar o uso de serviços de terceiros para facilitar o pagamento e a conclusão dos Pagamentos. Ao enviar suas informações de pagamento, você entende que podemos compartilhar essas informações com esses terceiros, sujeito à nossa Política de Privacidade. Seu Pagamento não está confirmado até que você receba um e-mail de confirmação de nós ou de nossos serviços de pagamento de terceiros. Em particular, reservamo-nos o direito de rejeitar seu Pagamento devido à indisponibilidade do produto ou serviço, ou se houver suspeita de fraude ou uma transação não autorizada ou ilegal.",
    text38:
      "Você pode cancelar sua conta a qualquer momento. Para usuários de assinatura paga, consulte também nossa Política de Reembolso ao solicitar o cancelamento de sua conta.",
    text39:
      "A Vidqu pode encerrar e/ou excluir sua conta imediatamente (i) no caso de violação ou infração dos Termos de Serviço por você ou (ii) conforme estabelecido na seção “Isenção de Garantia” (veja a seção 'Isenções de Responsabilidade' abaixo).",
    text40:
      "É proibido carregar, gravar, gerar e compartilhar conteúdo pornográfico, violento e outros conteúdos ilegais. Bloquearemos permanentemente sua conta assim que encontrarmos tal conteúdo.",
    text41:
      "Respeitamos os direitos de propriedade intelectual de todos e esperamos que nossos clientes façam o mesmo. De acordo com a Lei de Direitos Autorais do Milênio Digital de 1998, cujos detalhes podem ser encontrados no site do Escritório de Direitos Autorais dos EUA em <a href='https://www.copyright.gov/legislation/dmca.pdf'>https://www.copyright.gov/legislation/dmca.pdf</a>, responderemos seriamente a reivindicações de infração de direitos autorais cometidas usando os Serviços da Vidqu, se tais reivindicações forem relatadas a nós. Também nos reservamos o direito de tomar medidas, em circunstâncias apropriadas, para bloquear ou limitar o acesso aos nossos Serviços, remover ou desativar conteúdo alegadamente infrator e encerrar contas de usuários que infrinjam quaisquer direitos de propriedade intelectual de outros. Se você acredita que qualquer conteúdo carregado ou disponibilizado em nossa plataforma infringe qualquer direito autoral que você possui ou controla, envie um aviso para <a href='mailto:support@vidqu.ai'>support@vidqu.ai</a> com as informações necessárias abaixo.",
    text42: "1. Seu nome completo e sua assinatura física ou eletrônica.",
    text43:
      "2. Identificação da obra protegida por direitos autorais que você acredita ter sido infringida, ou forneça uma lista representativa das obras protegidas por direitos autorais, se várias obras estiverem envolvidas.",
