      "Se qualquer disposição deste TOS for considerada inválida ou inexequível, essa disposição deverá ser interpretada de maneira consistente com a lei aplicável para refletir a intenção original da disposição, e as disposições restantes deste TOS permanecerão em pleno vigor e efeito. Qualquer falha em exercer ou fazer cumprir qualquer direito ou a disposição deste TOS não constituirá uma renúncia a tal direito ou disposição.",
